import logo from './logo.svg';
import './App.css';
import Employee from './components/Employee';
import AdministratorOrders from './components/AdministratorOrders';
import Sidebar from './components/Sidebar';

import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import Login from './pages/Login';

function App() {
  return (
    <Router>
    <div className="App">

        <Switch>
          <Route exact path="/">
            <Login />
          </Route>
          <Route exact path="/administrator">
            <Sidebar />
          </Route>
        </Switch>

    </div>
    </Router>
  );
}

export default App;
